script: |
  super -f text -I q10503.spq | sort > q10503.out

inputs:
  - name: q10503.spq
    data: |
      SELECT + col0 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE + CAST ( NULL AS INTEGER ) IN ( - ( col0 ) * + + col2 * ( CAST ( 60 AS INTEGER ) ) + + 64 );
  - name: tab1

outputs:
  - name: q10503.out
    data: |
